 special formula. It is suitable for use in wood, concrete, prefabricated and steel structures.','images/products/isonem-anti-fire-paint.png','','published',86,'manuals/products/antifirepaint.pdf','','2022-09-04 12:22:37.714213','2022-09-04 12:22:37.714292',5,5,'20 KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(303,'THERMAL PAINT','thermal insulation','thermal-paint','is an elastomeric resin-based, contains special vacuum microspheres, have vapor-permeability, water-based, a low thermal conductivity, high sunlight absorbency, and high surface heat transmission value. Its activity is scientifically proved special insulating paint which provides the thermal and water insulation in the interior and exterior facades. It provides energy savings to buildings of up to 40% depending on the application layers number in heating and cooling energy costs. When the','images/products/isonem-thermal-paint.png','','published',81,'manuals/products/thermalpaint.pdf','','2022-09-04 12:26:56.916462','2022-09-25 08:27:04.034817',5,1,'20 KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(304,'MS 82','paints and decorative','ms-82','It is a very strong synthetic insulation paint which has been modified by special chemicals and polymers to eliminate the moisture and dampness problems in the interior and exterior walls of the buildings because of natural conditions. It can be applied to any kind of humid or dry walls, painted and unpainted surfaces. Thanks to its excellent alkali and moisture resistance, it prevents the formation of moisture on the walls and destroys if there is any. The adhesion strength in all kinds of surfaces is extremely strong, does not swell, high chemical resistance, it is not affected by UV, rain, water or salt. It is used in interior and exterior walls, in basements, in garages or in cellars, in interior walls facing north and in humid areas. It forms a film layer showing excellent moisture resistance on the surface applied. Even if the paint or wall is humid, it adheres very well to the surface. It is not affected by salt water and efflorescence. Thanks to this feature','images/products/isonem-ms-82-2.png','','published',80,'manuals/products/ms82.pdf','','2022-09-04 12:30:44.640243','2022-09-04 12:30:44.640309',5,5,'20 KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(305,'POOL','paints and decorative','pool','it is the swimming pool paint which is polyurethane resin based, consisting of two components, blue in color. It is not affected by water and water pressure. ISONEM POOL is particularly very ideal to use in swimming pools, newly made decorative pools in the cases where the ceramic covering will not use. It gives a homogeneous blue appearance on the surface applied. It is elastic, not crack, it is not affected by the UV lights and the swimming pool chemicals. The product has high resistance against alkali and chloride. Its color does not fade in time, not destroyed underwater, abrasion-proofing. The workmanship is very easy and economic.','images/products/isonem-pool1.png','','published',78,'manuals/products/pool.pdf','','2022-09-04 12:35:11.844973','2022-09-04 12:35:11.845014',5,5,'20KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(306,'ANTI MOLOTOV','paints and decorative','anti-molotov','A high-grade product developed for extinguishing fires of classes A, B, and C (European Classes) on the purpose of faster, safer and more effectively than its beginning. The only thing the user needs to do is throwing our product into the fire. When ISONEM ANTI MOLOTOV, which is in a special plastic package, is thrown into the fire, the plastic container breaks and extinguishes the fire immediately. It is a liquid extinguishing agent and when 