-29 08:08:03.902879','2022-09-29 08:14:10.366242',5,2,'20KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(388,'T POX 2800','epoxy and polyurethane','t-pox-2800','','','','published',1,'manuals/products/T-POX_2800_ZR____________TWO_COMPONENT_EPOXY_RESIN_BASED_PRIMER_-_ZINC__87fEGnO.pdf','','2022-10-01 07:39:54.883956','2022-10-01 11:43:50.468729',4,4,'20 KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(389,'EXTERNAL WALL THERMAL INSULATION STONE WOOL BOARD','thermal insulation','external-wall-thermal-insulation-stone-wool-board','By interlocking the fibers in stone wool board to form a complex fiber structure, resistance to withstand high pressure at lower densities is created. Braid\r\nfiber structure makes the sheathing implementation on the stone wool surface stronger. In this way, physical load carrying rate on the structure is being increased.\r\n Used for thermal and sound insulation and fire safety on external facades.','images/products/WhatsApp_Image_2022-10-17_at_10.29.08_AM.jpeg','','published',1,'manuals/products/150_100.pdf','','2022-10-18 09:00:30.594096','2022-10-18 09:00:30.594163',8,1,'KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(390,'PARTITION BOARD','thermal insulation','partition-board','Mineral wool - Thermal insulation material formed by melting of basalt stone at\r\n1350C-1400C into fiber -For thermal, sound and fire insulation\r\nUsed for thermal, sound and fire insulation for partition walls','images/products/WhatsApp_Image_2022-10-17_at_10.36.38_AM.jpeg','','published',1,'manuals/products/70_50.pdf','','2022-10-18 09:03:27.915010','2022-10-18 09:03:27.915066',8,1,'KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(391,'ROOF MATTRESS','thermal insulation','roof-mattress',' Roof mattress, unfaced, one or both sides covered with aluminum foil.\r\nUSAGE AREAS\r\n Roof surfaces,\r\n Between the purlin spacings.','images/products/WhatsApp_Image_2022-10-17_at_10.40.55_AM.jpeg','','published',1,'manuals/products/40_50.pdf','','2022-10-18 09:05:49.731171','2022-10-18 09:05:49.731238',8,1,'KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(392,'PREFABRICATED PIPE','thermal insulation','prefabricated-pipe','Non-coated or aluminum foil coated stone wool pipe used in mechanical installation insulations.\r\n Launched to the market in boxes.\r\nUSAGE AREAS\r\n Used for thermal saving and fire insulation in high temperature industrial and installation pipes.\r\n Used for sound and vibration insulation in process equipment.\r\nIMPLEMENTATION\r\n It is implemented noncoated or covered with aluminum foil depending on the area of use. After the prefabricated pipe, joints are fixed with screws, rivets, clamping or bonding method, with a special tape in aluminum foil.','images/products/WhatsApp_Image_2022-10-17_at_10.44.46_AM.jpeg','','published',1,'','','2022-10-18 09:07:35.632482','2022-10-18 09:07:35.632547',8,1,'KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','',''),(393,'CERAMIC FIBER','thermal insulation','ceramic-fiber','Ravatherm Ceramic Fiber is an insulating material that is used for applications in between 750C and 1430C thermal insulation needed, which is consist of (spun technology) long, flexible and combined woven fibers. Ceramic fiber consists three elements basicly; silica, alumina and zirconium and it is a thermal insulation material for high temperature. Ravatherm Ceramic Fiber blanket is used in the industrial furnace insulation, boiler, pipe and chimneys insulation and it also used in all technical insulations, which requires high temperature.','','','published',1,'','','2022-10-18 09:10:37.058477','2022-10-18 09:10:37.058510',8,1,'KG','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','','');
