INSERT INTO `website_theme` VALUES (1,'theme_1',1,'images/themes/Logo.png','images/themes/Logo_ZKEpZYs.png','images/themes/Brands_Header.jpg','','images/themes/Projects_Header.jpg','images/themes/Products_Header.jpg','images/themes/About-Us_Header.jpg','images/themes/Contact-us_Header.jpg','images/themes/Kalekim_1954.jpg','1954 PROFESYONEL MARBLE','High performance cementitious flexible adhesive with extended open time and reduced slip for ceramic tiles and stones.','images/themes/FN50.jpg','Thermal Insulation Plaster MOMENTUM FN-50','Cement based, expanded glass bead granule filled, polymer reinforced, special ,exterior and interior thermal insulation plaster.','images/themes/3.jpg','YURTBAY SERAMIK','Yurtbay Seramik stands out with its stylish and unique concept series that essentially carry the traces of natural textures inspired from the nature.','images/themes/4.jpg','T - POX 3100','is a low viscosity, solvent-free, two components, self-leveling, multi-purpose epoxy based coating.','images/themes/5.jpg','Kalekim 3151 ELASTICOOL','Acrylic dispersion based, one component, liquid plastic coating and waterproofing material which is highly elastic, and saves energy by reflecting radial heat energy on the surface of roofs.','images/themes/6.jpg','Kale Boya - 5122 JOKER PLUS EXT','Acrylic emulsion based, silicone enhanced, water repellent, long lasting exterior wall paint.','Excellent services','Send us an email to get started on your project, and we\'ll give you a contact right away.','Facts & figures','Since the company\'s inception to the moment, its policy has been to provide the finest materials and maintain up with modern construction technology, incorporating them as materials, experience, and work cadres, and making them readily available to the average investor and projects, whether they belong to public or private sector.\r\nWith the fact that we provide high-quality construction supplies, our company stands out from the competition. We have branches and departments for our materials all across Iraq, from Zakho to Basra.',100,1000,1500,200,18,'images/themes/Experience-frame-01_2_uXUkaHH.png','One of the leading businesses in processing and supplying construction materials, particularly engineering processing content in the Kurdistan region and Iraq.\r\nPany company was founded in 2004 with Turkish ceramics, upon becoming specialized in it, then lately evolving into one of the most importers and sellers of Turkish ceramics in Iraq, with particularly the Yurtbay Ceramics brand. It now has 113 main branches and retail stores in all over Iraq and has continued to expand its range of services, specializing in structural insulators, including waterproofing, thermal, acoustic, and fire insulators, among other things.\r\nOne of the most significant areas of our work in the company has been the floor treatments department, specifically epoxy, for which we offer specialist management and experienced team, we are pleased to announce that floor remedies and treatments are our area of expertise.\r\nThe following Turkish brands officially have our firm as their exclusive representative:\r\n	Yurtbay Ceramic.\r\n	Isonem for floors, water, and heat treatments.\r\n	Tesay for ceramic expansion joint accessories, including treads, angles, and segments.\r\n	Kalekim for Exterior and Interior Pigments, Adhesives, and Waterproofing\r\n	Izocam compressed cork insulation.\r\n	Momentum is a specialist in thermal insulation  and construction chemicals.','','Farhad Shahin','CEO of PANY','images/themes/WhatsApp_Image_2021-08-19_at_3.29.54_PM.jpeg','Our company, with its distinguished staff, held numerous of seminars in most cities for hundreds of engineers and contractors in order to promote its products and inform participants about new building and construction technology. It played a significant and recognized role in the development and enhancement of building and project efficiency.','Expert & Profestional','we offer the highest caliber of service throughout Iraq, as an exclusive agent.','High quality service','We provides the greatest and high-quality materials.','Affordable prices','we provide quality product and services under the supervision of well experienced Engineers and Architects to your doorstep on very affordable prices.','images/themes/Why-choose-us-01.jpg','images/themes/Untitled-7-01.png','images/themes/Contact-Us-01.png','images/themes/footer_1024x366_overlay_02.jpg','images/themes/7.jpg','images/themes/ArtFloor.jpg','It is produced by extrusion from polystyrene raw materials. It can be produced as a plate in different size and compression strength.','The Artfloor laminate flooring, which is a complete flooring system, is produced in the AC3, AC4 and AC5 alternatives, as a material obtained by the coating of two surfaces using materials such as dec','Extruded Polystyrene (XPS)','Laminate Flooring','','(+964) 750 450 6664');
